import React from "react";
const Home = () => {
  const container = {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
  };
  return (
    <>
      <div style={container}>
        <h1>Welcome to Login Page</h1>
      </div>
    </>
  );
};
export default Home;
